import React from 'react';
import { useNavigate } from 'react-router-dom';
import { useSelector, useDispatch } from 'react-redux';
import * as S from './LandingPage.styled.js';
import {lockLanding} from '../../redux/actions.js';

export default function LandingPage(){
  const { landingLocked } = useSelector(state => state);
  const dispatch = useDispatch();
  const navigate = useNavigate();
  landingLocked && navigate('/');

  function quitLanding() {
    dispatch(lockLanding());
    console.log(landingLocked)
    navigate('/');
  }

  return(
    <S.LandingPage> 
      <S.Button onClick={ quitLanding }> LET'S COOK! </S.Button> 
    </S.LandingPage>
  )
}
